import React from "react";

function Checker(props){

    let player = props.checker.player;
    let color = player === 1 ? "checker-player1" : "checker-player2";
    let classes = "checker " + color;
    console.log(classes);
    


    
    return(
        <div className={classes}>
        </div>
    );

}

export default Checker;
